import React, { useState, useEffect } from 'react'
import axios from 'axios'
function DataFetingPhoto() {
  const [commons, setCommons] = useState({})
  const [id, setId] = useState(20)

  useEffect(() => {
    axios
      .get(`http://localhost:3333/data/${id}`)
      .then(res => {
        setCommons(res.data)
      })
      .catch(err => {
        console.log(err)
      })
  }, [id])
  console.log(commons)
  return (
    <div>
      <input type value={id} onChange={e => setId(e.target.value)} />
      {commons[0] &&
        commons.map((common, i) => (
          <div key={i}>
            <p>{common.invited_people && common.invited_people.name}</p>
          </div>
        ))}
    </div>
  )
}

export default DataFetingPhoto
